// Floating menu seen on home page
import './Menu.css'

const Menu = () => {
    return (
        <div className="menu">
            <span className="menuText">Owen Boseley</span>
            <span className="typeBar" className="menuText">_</span>
        </div>
    );
}

export default Menu;
